        <div style={{display: 'inline-block',marginLeft: '140px',marginTop: '160px',}}>
          <HeadTitle firstPartFont='../assets/shou.png' thirdPartFont='游记讯息'>
            <img className='headImg' src={shou}></img>
          </HeadTitle>
          <HeadTitle firstPartFont='../assets/guan.png' thirdPartFont='博物馆志'>
            <img className='headImg' src={guan}></img>
          </HeadTitle>
          <HeadTitle firstPartFont='../assets/gui.png' thirdPartFont='行程规划'>
            <img className='headImg' src={gui}></img>
          </HeadTitle>
        </div>
        <div>
          <TimeLineCom />
        </div>
        <div style={{display: 'inline-block',marginLeft: '140px',marginTop: '160px',height:'100px',width:'1px',background:'#E5E5E5',}}>
        </div>
      </div>
    )
  }
}

export default App;
